// FunctionPage.js
import React, { useEffect, useState } from 'react';
import { useAuth } from '../../contexts/AuthContext'; // Adjust the import path as needed
import CalendarHeatmap from 'react-calendar-heatmap';
import 'react-calendar-heatmap/dist/styles.css'; // Import default styles for the heatmap
import './FunctionPage.css'; // Import your custom CSS file

const FunctionPage = () => {
  const { userEmail, token } = useAuth(); // Access the user's email and token from the AuthContext
  const [heatmapData, setHeatmapData] = useState([]); // State to store heatmap data
  const [searchWord, setSearchWord] = useState(''); // State to store the search input
  const [searchResult, setSearchResult] = useState(null); // State to store the search result

  useEffect(() => {
    const fetchHeatmapData = async () => {
      if (!token) {
        console.error('No token found, please log in.');
        return;
      }

      try {
        const response = await fetch('https://cp.dhytv.com/v1/stats/heatmap', {
          method: 'GET',
          headers: {
            'Authorization': `Bearer ${token}`, // Include the token from the AuthContext in the Authorization header
            'Content-Type': 'application/json',
          },
        });

        if (!response.ok) {
          throw new Error('Failed to fetch heatmap data');
        }

        const data = await response.json();
        console.log(data);

        // Process the data to match the format required by react-calendar-heatmap
        const processedData = data.map((item) => ({
          date: item.date, // Adjust according to the actual data structure
          count: item.count,
        }));

        setHeatmapData(processedData);
      } catch (error) {
        console.error('Error fetching heatmap data:', error);
      }
    };

    fetchHeatmapData();
  }, [token]); // Re-run the effect if the token changes

  const handleSearchSubmit = async (event) => {
    event.preventDefault(); // Prevent page reload on form submission

    if (!token) {
      console.error('No token found, please log in.');
      return;
    }

    try {
      const response = await fetch(`https://cp.dhytv.com/v1/dicts/word/${searchWord}`, {
        method: 'GET',
        headers: {
          'Authorization': `Bearer ${token}`, // Include the token from the AuthContext in the Authorization header
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        const errorData = await response.json();
        console.error('Server Error:', errorData.message || 'Failed to fetch word data');
        throw new Error(errorData.message || 'Failed to fetch word data');
      }

      const resultData = await response.json();
      console.log(resultData);
      setSearchResult(resultData); // Update state with search result
    } catch (error) {
      console.error('Error fetching word data:', error);
      setSearchResult(null); // Clear previous results if there is an error
    }
  };

  return (
    <div>


    <div className="function-page">
      {/* Main container for two-column layout */}
      <div className="function-page-container">
        {/* Left panel for Word Search (1/3 width) */}
        <div className="left-panel">
          <section className="section-box">
            <h2>Word Search</h2>

            <form onSubmit={handleSearchSubmit}>
              <input
                type="text"
                placeholder="Enter a word to search"
                value={searchWord}
                onChange={(e) => setSearchWord(e.target.value)} // Update the state with the search input
              />
              <button type="submit">Search</button>
            </form>

            {/* Display the search result if available */}
            {searchResult && (
              <div>
                <h3>Search Result for "{searchWord}":</h3>
                <p>{JSON.stringify(searchResult)}</p> {/* Display raw JSON or format as needed */}
              </div>
            )}
          </section>
        </div>

        {/* Right panel for other content (2/3 width) */}
        <div className="right-panel">
          {/* Welcome message with user's name or email */}


          {/* Section for English-Chinese vocabulary */}
          <section className="section-box">
            <h2>Current Dictionary</h2>
            <p>English-Chinese</p>
            {/* ... Your vocabulary section goes here ... */}
          </section>

          {/* Section for vocabulary progress */}
          <section className="section-box">
            <h2>Learning Progress</h2>
            {/* ... Your progress section goes here ... */}
          </section>

          {/* Heatmap Section */}
          <section className="section-box">
            <h2>Learning Heatmap 2024</h2>
            <CalendarHeatmap
              startDate={new Date('2024-01-01')}
              endDate={new Date('2024-12-31')}
              values={heatmapData}
              classForValue={(value) => {
                if (!value) {
                  return 'color-empty';
                }
                return `color-github-${Math.min(value.count, 4)}`; // Customize the color based on count
              }}
            />
          </section>
        </div>
      </div>
    </div>
    </div>
  );
};

export default FunctionPage;
